export const FETCH_PRODUCTS = "FETCH_PRODUCTS";

const fetchProducts = () => dispatch => {
  fetch("https://jsonserverherokukn.herokuapp.com/products")
    .then(res => res.json())
    .then(data => {
      console.log(data);
      return { type: "FETCH_PRODUCTS", payload: data };
    });
};
export default fetchProducts;
